import React from "react";
import styled from "styled-components";

const ModalContainer = styled.div`
  width: 70%;
  height: 600px;
  align-items: center;
  justify-content: center;
  background-color: white;
  position: absolute;
  margin-top: 300px;
`;

const Modal = () => {
  return <ModalContainer>1234</ModalContainer>;
};

export default Modal;
